INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2013-11-21 06:57:06', '2013-11-21 06:57:11', 1),
(2, 'block_home_who', 'block_home_who', '<div class="who-we-are">\r\n<div class="row-fluid who-center">\r\n<h1 class="title">Who we are ?</h1>\r\n</div>\r\n<div class="row-fluid who-top">\r\n<div class="span3"><img src="{{media url="wysiwyg/Ippolito-Etro.png"}}" alt="" />\r\n<h2>Ippolito Etro</h2>\r\n<p>Il mio &egrave; un lavoro emotivo. Osservo tutto e accumulo sensazioni e ispirazioni che condivido con il mio team creativo. Ho un quaderno di appunti dove annoto ci&ograve; che mi colpisce.</p>\r\n<a href="#">READ MORE</a></div>\r\n<div class="span3"><img src="{{media url="wysiwyg/Kean-Etro.png"}}" alt="" />\r\n<h2>Kean Etro</h2>\r\n<p>Il mio &egrave; un lavoro emotivo. Osservo tutto e accumulo sensazioni e ispirazioni che condivido con il mio team creativo. Ho un quaderno di appunti dove annoto ci&ograve; che mi colpisce.</p>\r\n<a href="#">READ MORE</a></div>\r\n<div class="span3"><img src="{{media url="wysiwyg/Jacopo-Etro.png"}}" alt="" />\r\n<h2>Jacopo Etro</h2>\r\n<p>Il mio &egrave; un lavoro emotivo. Osservo tutto e accumulo sensazioni e ispirazioni che condivido con il mio team creativo. Ho un quaderno di appunti dove annoto ci&ograve; che mi colpisce.</p>\r\n<a href="#">READ MORE</a></div>\r\n<div class="span3"><img src="{{media url="wysiwyg/Veronica--Etro.png"}}" alt="" />\r\n<h2>Veronica Etro</h2>\r\n<p>Il mio &egrave; un lavoro emotivo. Osservo tutto e accumulo sensazioni e ispirazioni che condivido con il mio team creativo. Ho un quaderno di appunti dove annoto ci&ograve; che mi colpisce.</p>\r\n<a href="#">READ MORE</a></div>\r\n</div>\r\n</div>', '2014-01-22 08:24:24', '2014-01-22 08:24:24', 1),
(3, 'block_brand_list', 'block_brand_list', '<ul class="slides">\r\n<li><img src="{{media url="wysiwyg/Health-Care.png"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/Hotel.png"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/Restaurant.png"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/Retail.png"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/Health-Care.png"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/Hotel.png"}}" alt="" /></li>\r\n</ul>', '2014-01-22 08:25:15', '2014-01-22 13:09:12', 1),
(4, 'block_bottom_info', 'block_bottom_info', '<ul>\r\n<li>[icon name="icon-truck"] Free Shipping</li>\r\n<li>[icon name="icon-gift"] Continuous Promotion</li>\r\n<li>[icon name="icon-gauge"] 30-Day Returns</li>\r\n<li>[icon name="icon-award"] Top seller</li>\r\n</ul>', '2014-01-22 08:25:57', '2014-01-22 08:25:57', 1),
(5, 'block_about_box', 'block_about_box', '<div class="span4">\r\n<p><a href="#"><img src="{{media url="wysiwyg/shutterstock_150387635.jpg"}}" alt="" /></a></p>\r\n</div>\r\n<div class="span8">\r\n<h4>GET YOUR APP</h4>\r\n<p>Tje socialvoucher Mobile Application is available on both Apple as well as Google play store ,</p>\r\n</div>', '2014-01-22 08:26:58', '2014-01-22 08:26:58', 1),
(6, 'home_3_banner', 'home_3_banner', '<div class="row-fluid">\r\n<div class="span4"><a href="#"><img src="{{media url="wysiwyg/share-img.png"}}" alt="" /></a></div>\r\n<div class="span4"><a href="#"><img src="{{media url="wysiwyg/save-img.png"}}" alt="" /></a></div>\r\n<div class="span4"><a href="#"><img src="{{media url="wysiwyg/simple-img.png"}}" alt="" /></a></div>\r\n</div>', '2014-01-22 09:32:36', '2014-01-22 12:59:38', 1),
(7, 'block_contact_box', 'block_contact_box', '<div class="span5">\r\n<p class="phone">[icon name="icon-mobile"] (866)323-2132</p>\r\n<p class="fax">[icon name="icon-print"] (561)238-6637</p>\r\n<p class="support" style="width: 170px;">[icon name="icon-mail"] <span>info@socialvoucher.com</span></p>\r\n</div>\r\n<div class="span7">\r\n<ul class="social-icons">\r\n<li class="twitter"><a href="#">[icon name="icon-twitter-rect"]</a></li>\r\n<li class="facebook"><a href="#">[icon name="icon-facebook-rect"]</a></li>\r\n<li class="googleplus"><a href="#">[icon name="icon-gplus"]</a></li>\r\n<li class="linkedin"><a href="#">[icon name="icon-linkedin-squared"]</a></li>\r\n<li class="youtube"><a href="#">[icon name="icon-vimeo"]</a></li>\r\n</ul>\r\n</div>', '2014-01-23 04:26:37', '2014-01-29 07:26:02', 1);
