(10, 'how it works', 'one_column', NULL, NULL, 'how-it-works', NULL, '<div class="main">\r\n<div class="width_full margin-none">\r\n<div class="wrapper">\r\n<div class="how_it_works" style="background: url(''http://socialvoucher.com/images/howitworks_border.jpg'') repeat-y scroll center center rgba(0, 0, 0, 0); float: left; padding: 30px 0; width: 100%;">\r\n<div class="how_work_block right" style="background: url(''http://socialvoucher.com/images/devider-right.png'') no-repeat scroll left center rgba(0, 0, 0, 0); float: right; left: 37px; position: relative; clear: both; display: block; margin-top: 20px; min-height: 100px; width: 55%;">\r\n<div class="left" style="float: left !important; left: 55px; position: relative; width: 126px;"><img title="Download App" src="{{media url="download-icon.png"}}" alt="Download App" /></div>\r\n<div class="right" style="float: right !important; width: 270px;">\r\n<h3>Download Social Voucher</h3>\r\n<p>Go to the app store using your mobile phone and download the social voucher application.</p>\r\n</div>\r\n</div>\r\n<div class="how_work_block left" style="background: url(''http://socialvoucher.com/images/devider-left.png'') no-repeat scroll right center rgba(0, 0, 0, 0); float: left; left: -37px; position: relative; clear: both; display: block; margin-top: 20px; min-height: 100px; width: 55%;">\r\n<div class="left" style="float: right !important; left: -55px; position: relative; width: 126px;"><img title="Find Local Business With the Best Offers" src="{{media url="find-solution-icon.png"}}" alt="Find Local Business With the Best Offers" /></div>\r\n<div class="right" style="float: left !important; width: 270px;">\r\n<h3>Find Local Business With the Best Offers</h3>\r\n<p>Using the Social Voucher application select the Voucher that you would like to redeem.</p>\r\n</div>\r\n</div>\r\n<div class="how_work_block right" style="background: url(''http://socialvoucher.com/images/devider-right.png'') no-repeat scroll left center rgba(0, 0, 0, 0); float: right; left: 37px; position: relative; clear: both; display: block; margin-top: 20px; min-height: 100px; width: 55%;">\r\n<div class="left" style="float: left !important; left: 55px; position: relative; width: 126px;"><img title="Share and Save" src="{{media url="share-save-icon.png"}}" alt="Share and Save" /></div>\r\n<div class="right" style="float: right !important; width: 270px;">\r\n<h3>Share and Save</h3>\r\n<p>Simply share your Voucher with your friends to activate your savings.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2014-01-09 06:26:01', '2014-01-29 06:26:49', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'business features', 'one_column', NULL, NULL, 'business-features', NULL, '<div class="wrapper">\r\n<div class="business-feature" style="width: 100%; float: left;">\r\n<div class="feature-box" style="width: 483px; float: left; margin-top: 40px;">\r\n<div class="left" style="width: 120px; float: left;"><img title="Social Customer Engagement" src="{{media url="social-customer-icon.png" }}" alt="Social Customer Engagement" width="118" height="117" /></div>\r\n<div class="right" style="width: 320px; float: right;">\r\n<h2>Social Customer Engagement</h2>\r\n<p>Reach the social circles of your customers with direct offers and promotions.</p>\r\n</div>\r\n</div>\r\n<div class="feature-box" style="width: 483px; float: left; margin-top: 40px;">\r\n<div class="left" style="width: 120px; float: left;"><img title="Full Analytics and Tracking" src="{{media url="analytics-icon.png"}}" alt="Full Analytics and Tracking" width="118" height="117" /></div>\r\n<div class="right" style="width: 320px; float: right;">\r\n<h2>Full Analytics and Tracking</h2>\r\n<p>Share your offer with your friends and family on your favorite social network.</p>\r\n</div>\r\n</div>\r\n<div class="feature-box" style="width: 483px; float: left; margin-top: 40px;">\r\n<div class="left" style="width: 120px; float: left;"><img title="Cross Market with Local Businesses" src="{{media url="cross-market-icon.png"}}" alt="Cross Market with Local Businesses" width="118" height="117" /></div>\r\n<div class="right" style="width: 320px; float: right;">\r\n<h2>Cross Market with Local Businesses</h2>\r\n<p>Meet other local businesses in your area who can help spread the word about your promotions to their customers base.</p>\r\n</div>\r\n</div>\r\n<div class="feature-box" style="width: 483px; float: left; margin-top: -120px;">\r\n<div class="left" style="width: 120px; float: left;"><img title="Loyalty Program" src="{{media url="loyalty-icon.png"}}" alt="Loyalty Program" width="118" height="117" /></div>\r\n<div class="right" style="width: 320px; float: right;">\r\n<h2>Loyalty Program</h2>\r\n<p>Keep your customers updated with your most current offers and promotions and keep them coming back.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div style="width: 100%;">\r\n<div class="width_full gra_bg" style="float: left; margin-top: 45px; padding: 45px 0;">\r\n<div class="wrapper" style="margin: 0 auto; position: relative; width: 970px;">\r\n<div class="about_voucher">\r\n<div class="left" style="float: left; width: 460px;">\r\n<h2 style="color: #000000; font-size: 30px; font-weight: normal; margin: 0;">About Social Voucher</h2>\r\n<h3 style="color: #000000; font-size: 17px; font-weight: bold; margin-top: 5px;">Adopt Social Voucher and Watch Your Business Grow!</h3>\r\n<p style="color: #666666; float: left; font-size: 15px; line-height: 23px; margin-top: 20px; width: 100%;">Vouching is the latest trend as well as the best compliment a customer can give your business. When a customer "Vouches" for your business, they are not only adding credibility by vouching to their overall experience, but they are also sharing a discount voucher with their closest friends and family.</p>\r\n<p style="color: #666666; float: left; font-size: 15px; line-height: 23px; margin-top: 20px; width: 100%;">Since we trust our friends and family more than conventional advertising, this makes social voucher a powerful tools for your business.</p>\r\n<div class="app-info"><a class="iphone" style="background: url(''http://socialvoucher.com/images/apple-icon.png'')no-repeat scroll 30px 7px #45A9DA; border-radius: 5px; color: #ffffff; float: left; font-size: 18px; padding: 10px 40px 10px 65px;" href="#">iPhone</a> <a class="android" style="background: url(''http://socialvoucher.com/images/android-icon.png'')no-repeat scroll 30px 7px #80B50D; border-radius: 5px; color: #ffffff; float: left; font-size: 18px; padding: 10px 40px 10px 65px; margin-left: 10px;" href="#">Android</a></div>\r\n</div>\r\n<div class="right" style="float: right; width: 460px;"><iframe src="http://goanimate.com/player/embed/0U2Y10MRkMTs" frameborder="0" scrolling="no" width="400" height="225"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2014-01-09 06:26:29', '2014-01-29 06:28:07', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
